You may set the following properties to further configure the call. Please note that  -p  is followed by one 
or more key-value-pairs, and is called like this  -p k1=v1 k2=v2  even though the listing below repeats the -p  for completeness.   -p key-ring-id=string  Required. It must be unique within a location and match the regular
    expression  [a-zA-Z0-9_-]{1,63}

